Por disposición de la Dirección de Sanidad Policial, los hijos beneficiarios del Subsistema de Sanidad Policial, mayores de 18 años y menores de 25, no deben adjuntar certificación de escolaridad.

Por favor consultar los requisitos en el portal www.casur.gov.co pestañas Atención al ciudadano/ Carnetización.

Además, la Dirección de Sanidad Policial ha dispuesto para el personal residente en cada departamento, un correo electrónico para atender los trámites de carnetización y actualización de datos del personal con derecho a estos servicios.

Casur presta apoyo a la Disan en la actualización de los datos SIATH y en el proceso de carnetización, recibe las inquietudes de la reserva policial y las transmite al área correspondiente.

